      <div className="container">
        {/* ブログタイトル */}
			  <div className="home-title">
          <h3>古のほ～むぺ～じ、令和に生きる…</h3>
          {/* 横スクロール */}
          <div  class="marquee">
            <p id="marL">
              ☆★☆★☆★☆ゆっくりしていってね！☆★☆★☆★☆★
            </p>
          </div>

				  <Link to={`/`}>
            <figure>
              <GatsbyImage
                image={data.title.childImageSharp.gatsbyImageData}
                alt="blog-title" style={{ height: "100%" }} />
            </figure>
          </Link>

          {/* 横スクロール */}
          <div  class="marquee">
            <p id="marR">
              ！！！不具合報告はTwitter(X)<a href="https://twitter.com/oRihaRakuN">@oriharakun</a>まで！！！
            </p>
          </div>
        </div>

        {/* アクセスカウンター */}
        <div className="access-counter">
          <p>あなたは
            <img src="http://www.rays-counter.com/d490_f6_022/6102bd71e104f/" alt="アクセスカウンター" border="1" />番目のお客様です。</p>
			    <p>キリ番？ハハァ…</p>
			    <p>最終更新: {data.siteBuildMetadata.buildTime}</p>
        </div>

        {/* グリッドシステム */}
        <div className="grid-layout">

          {/* プロフィール */}
            <div id="a1" className="frame-pink">
              <article className="home-card-prof">
              <Link to={`/about/`}>
                <h2>ゆるりゆらり折原</h2>
                <p>
                  オリハラの オリハラによる オリハラのための WEBサイト。
  						    なんかを作ったりしたらこのページに
                  あげるようなあげないようなそんなサイトです。シクヨロ
                </p>
              </Link>
            </article>
          </div>

          {/* アイコン */}
          <div id="b1" className="frame-pink">
            <article className="home-card-icon">
              <Link to={`/ar-game/`}>
                <figure>
                  <img src={data.kurumi.publicURL} alt={data.kurumi.name} />
                </figure>
              </Link>
            </article>
          </div>

          {/* 更新日記（あのね） */}
            <div id="a2" className="frame-green">
              <article className="home-card-about">
                <Link to={`/about/`}>
                  <h2>あのね</h2>
                  {data.about.edges.map(({ node }) => (
                    <div key={node.id}>
                      <div dangerouslySetInnerHTML={{ __html: `${node.content}`, }} />
                    </div>
                  ))}
                </Link>
              </article>
            </div>


          {/* トップ絵 */}
          <div id="c1" className="frame-pink">
            <article className="home-card-topillust">
            {data.illust.edges.map(({ node }) => (
              <div key={node.id}>
              <Link to={`/ar-illust/`}>
                <div dangerouslySetInnerHTML={{ __html: `${node.content}`, }} />
                <h2>{node.title}</h2>
              </Link>
              </div>
            ))}
            </article>
          </div>

          {/* 目次 */}
          <div id="d1" className="frame-green">
            <article className="home-card-index">
              <div className="imdex-image">
                {/* ホーム */}
                <Link to="/">
                  <figure>
                    <GatsbyImage
                      image={data.indexhome.childImageSharp.gatsbyImageData}
                      alt={data.indexhome.childImageSharp.fluid.originalName}
                    />
                  </figure>
                </Link>
                {/* あのね */}
                <Link to="/about/">
                  <figure>
                    <GatsbyImage
                      image={data.indexabout.childImageSharp.gatsbyImageData}
                      alt={data.indexabout.childImageSharp.fluid.originalName}
                    />
                  </figure>
                </Link>
                {/* マンガ */}
                <Link to="/ar-comic/">
                  <figure>
                    <GatsbyImage
                      image={data.indexcomic.childImageSharp.gatsbyImageData}
                      alt={data.indexcomic.childImageSharp.fluid.originalName}
                    />
                  </figure>
                </Link>
                {/* ゲーム */}
                <Link to="/ar-game/">
                  <figure>
                    <GatsbyImage
                      image={data.indexgame.childImageSharp.gatsbyImageData}
                      alt={data.indexgame.childImageSharp.fluid.originalName}
                    />
                  </figure>
                </Link>
                {/* コウサク */}
                <Link to="/ar-made/">
                  <figure>
                    <GatsbyImage
                      image={data.indexmade.childImageSharp.gatsbyImageData}
                      alt={data.indexmade.childImageSharp.fluid.originalName}
                    />
                  </figure>
                </Link>
                {/* イラスト */}
                <Link to="/ar-illust/">
                  <figure>
                    <GatsbyImage
                      image={data.indexillust.childImageSharp.gatsbyImageData}
                      alt={data.indexillust.childImageSharp.fluid.originalName}
                    />
                  </figure>
                </Link>
              </div>
            </article>
          </div>

          {/* ラインスタンプ広告 */}
          <div id="d2" className="frame-pink">
            <article className="home-card-linestamp">
              <h2>LINE STAMP</h2>
              <a href="/">ここに絵</a>
            </article>
          </div>

          {/* 更新履歴 */}
          <div id="e2" className="frame-pink">
            <article className="home-card-update">
              <h2>更新履歴</h2>
              <div dangerouslySetInnerHTML={{ __html: `${data.update.content}`, }} />
            </article>
          </div>

          {/* おしらせ */}
          <div id="d3" className="frame-green">
            <article className="home-card-news">
              <h2>おしらせ</h2>
              <p>外部での活動報告とかはここに書くかもです</p>
            </article>
          </div>

          {/*最新記事*/}
          <div id="a3" className="frame-pink">
            <article className="home-card-article">
              <h2>最新記事</h2>
              <section>
                {data.newarticle.edges.map(({ node }) => (
                  <div className="new" key={node.id}>
                    <Link to={`/blog/post/${node.category.categorySlug}/${node.slug}`}>
                      <h3>{node.title}</h3>
                      <figure>
                        <ImgixGatsbyImage
                          src={node.eyecatch.url}
                          imgixParams={{ auto: ["format", "compress"] }}
                          layout="constrained"
                          sourceWidth={node.eyecatch.width}
                          sourceHeight={node.eyecatch.height}
                          style={{ width: "100%" }}
                          alt={node.title}
                        />
                      </figure>
                    </Link>
                  </div>
                ))}
              </section>
            </article>
          </div>

          {/* OFUSE */}
          <div id="a4" className="frame-green">
            <article className="home-card-ofuse">
              <h2>お布施</h2>
              <div className="ofuse">
                <div className="ofuse-a">
                  <a href="https://ofuse.me/o?uid=41821">OFUSEする</a>
                </div>
                {/* ブログパーツ */}
                <div className="ofuse-button">
                  <a
                  data-ofuse-widget-button
                  href="https://ofuse.me/o?uid=41821"
                  data-ofuse-id="41821"
                  data-ofuse-size="small"
                  data-ofuse-color="pink">
                    OFUSEする
                  </a>
                  <Script async src="https://ofuse.me/assets/platform/widget.js" />
                </div>
              </div>
            </article>
          </div>

          {/* おすすめ */}
          <div id="b4" className="frame-pink">
            <article className="home-card-recommend">
              <h2>今月のおすすめ</h2>
              {data.recommend.edges.map(({ node }) => (
                <div key={node.id}>
                  <div dangerouslySetInnerHTML={{ __html: `${node.html}`, }} />
              </div>
            ))}
            </article>
          </div>

          {/* 格言 */}
          <div id="e4" className="frame-pink">
            <article className="home-card-kakugen">
              <h2>格言</h2>
              <p>「芸能人はカードが命！」</p>
            </article>
          </div>

        </div>
      </div>

      {/* 区切れ目*/ }
