export default Index;

export const query = graphql`
query {
  title: file(relativePath: {eq: "top_title2_3.png"}) {
    childImageSharp {
      gatsbyImageData(quality: 90, layout: FULL_WIDTH)
    }
  }
  kurumi: file(relativePath: {eq: "gifs/kurumi_walk.gif"}) {
    publicURL
    name
  }
  about: allMicrocmsBlogs(
    filter: {category: {categorySlug: {eq: "about"}}}
    limit: 1
    sort: {publicDate: DESC}
  ) {
    edges {
      node {
        id
        content
      }
    }
  }
  illust: allMicrocmsBlogs(
    limit: 1
    sort: {publicDate: DESC}
    filter: {category: {categorySlug: {eq: "ar-illust"}}}
  ) {
    edges {
      node {
        id
        title
        content
      }
    }
  }
  indexhome: file(relativePath: {eq: "nav2/logo-icon-ver.4-home.png"}) {
    childImageSharp {
      gatsbyImageData
      fluid {
        originalName
      }
    }
  }
  indexabout: file(relativePath: {eq: "nav2/logo-icon-ver.4-about.png"}) {
    childImageSharp {
      gatsbyImageData
      fluid {
        originalName
      }
    }
  }
  indexcomic: file(relativePath: {eq: "nav2/logo-icon-ver.4-comic.png"}) {
    childImageSharp {
      gatsbyImageData
      fluid {
        originalName
      }
    }
  }
  indexgame: file(relativePath: {eq: "nav2/logo-icon-ver.4-game.png"}) {
    childImageSharp {
      gatsbyImageData
      fluid {
        originalName
      }
    }
  }
  indexmade: file(relativePath: {eq: "nav2/logo-icon-ver.4-made.png"}) {
    childImageSharp {
      gatsbyImageData
      fluid {
        originalName
      }
    }
  }
  indexillust: file(relativePath: {eq: "nav2/logo-icon-ver.4-illust.png"}) {
    childImageSharp {
      gatsbyImageData
      fluid {
        originalName
      }
    }
  }
  update: microcmsBlogs(category: {categorySlug: {eq: "update"}}) {
    content
  }
  newarticle: allMicrocmsBlogs(
    limit: 3
    sort: {publicDate: DESC}
    filter: {category: {categorySlug: {glob: "ar*"}}}
  ) {
    edges {
      node {
        id
        title
        slug
        category {
          categorySlug
        }
        eyecatch {
          url
          width
          height
        }
      }
    }
  }
  siteBuildMetadata {
    buildTime(formatString: "YYYY年MM月DD日hh時mm分")
  }
  recommend: allMarkdownRemark {
    edges {
      node {
        id
        html
      }
    }
  }
}
`
